import React from 'react';
import styled from 'styled-components';
const MainCompo = ({ title }) => {
  const Root = styled.div`
    background-color: skyblue;
  `;
  return (
    <>
      <Root>{title}</Root>
    </>
  );
};

export default MainCompo;
